import styled from "styled-components";

import { IBenefit } from "@interfaces";
// import { CouponItem } from "./Item";

interface IProps {
    data: IBenefit[];
    handleClick: (id: string) => void;
}

export const ComponentHistoryList = (props: IProps) => {
    const { data, handleClick } = props;

    return (
        <StyledContainer>
            {data.map((item) => {
                return <BenefitItem handleClick={handleClick} data={item} key={item._id} />;
            })}
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
`;
